import './App.css';

function App() {
  return (
    <div className="App">
      <div className="side-bar">

      </div>
      <div>
        <header className="header flex-column-center">Header</header>
        <body className="body">Body</body>
        <footer className="footer flex-column-center">Footer</footer>
      </div>
    </div>
  );
}

export default App;
